3) AODA assessment and follow through;
4) submit to random drug screens and pay for same;
5) pay restitution of $1,958.43 to PK Beans and Cream; $100.00 to State Farm Insurance; and $1,705.00 to Francisca Jaimes, owner of Mr. Taco Mexican Restaurant;
6) have no contact with Park View Haven, PK Beans and Cream or Francisca Jaimes, owner of Mr. Taco Mexican Restaurant;
7) pay court costs, including costs of $798.00 from case no: 14 CF 396;
8) pay supervision fees in an amount to be determined by DOC.
